import React, { Component } from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
  width: 50px;
  height: 50px;
  background: red;
`

const Topic = styled.h1`
  color: #4b7abc;
  text-transform: uppercase;
  text-align: center;
  letter-spacing: 3px;
  margin: 0 0 20px;
`

export default Topic
